import React from 'react';
import './VascularSurgery.css';

const VascularSurgery = () => {
  return (
    <section className="vascular-surgery">
      <div className="content">
        <h2>Vascular Surgery</h2>
        <p>
          Vascular surgery is a specialty of surgery in which diseases of the vascular system, or arteries, veins, and lymphatic circulation, are managed by medical therapy, minimally-invasive catheter procedures, and surgical reconstruction.
        </p>
        <p>
          The field of vascular surgery began to expand with the discovery of minimally invasive techniques such as angioplasty and stenting.
        </p>
        <p>
          Vascular surgeons treat a wide range of health problems affecting the arteries and veins, including:
        </p>
        <ul>
          <li>Aneurysms</li>
          <li>Peripheral artery disease (PAD)</li>
          <li>Carotid artery disease</li>
          <li>Venous diseases such as varicose veins and deep vein thrombosis (DVT)</li>
        </ul>
        <p>
          The aim of vascular surgery is to restore normal blood flow to affected areas of the body and improve overall health and quality of life for patients.
        </p>
      </div>
    </section>
  );
};

export default VascularSurgery;
